import { makeAutoObservable } from "mobx";
export default class DeviceStore {
  constructor() {
    this._types = [
      { id: 0, name: "telefoni" },
      { id: 1, name: "holodosi" },
      { id: 2, name: "tvision" },
      { id: 3, name: "compi" },
    ];
    this._brands = [
      { id: 0, name: "apple" },
      { id: 1, name: "lg" },
      { id: 2, name: "hp" },
      { id: 3, name: "samsung" },
      { id: 4, name: "ssung" },
      { id: 5, name: "sam" },
    ];
    this._device = [
      {
        id: 1,
        name: "12 pro",
        price: 24400,
        rating: 5,
        img: "data:image/jpeg;base64,",
      },

      {
        id: 2,
        name: "13 pro",
        price: 200,
        rating: 5,
        img: "data:image/jpeg;base64,",
      },

      {
        id: 3,
        name: "104-auf",
        price: 24400,
        rating: 5,
        img: "data:image/jpeg;base64,",
      },
    ];
    this._selectedType = {};
    this._selectedBrand = {};
    makeAutoObservable(this);
  }

  setTypes(types) {
    this._types = types;
  }
  setBrands(brands) {
    this._brands = brands;
  }
  setDevices(device) {
    this._device = device;
  }
  setSelectedType(type) {
    this._selectedType = type;
  }
  setSelectedBrand(brand) {
    this._selectedBrand = brand;
  }

  get types() {
    return this._types;
  }
  get brands() {
    return this._brands;
  }
  get device() {
    return this._device;
  }
  get selectedType() {
    return this._selectedType;
  }
  get selectedBrand() {
    return this._selectedBrand;
  }
}
